import React from 'react'
import { Link } from 'react-router-dom';

function Header() {

    const arr = [
        {id:0,title:"hakkimizda"},
        {id:1,title:"iletisim"},
        {id:2,title:"profil"}
    ];
    let links = arr.map((item)=> item.title)
    console.log(arr)

    return (
           <div className="nav">
                            <ul>
                                   <li>
                                        <Link to="/">
                                            Anasayfa
                                        </Link>
                                   </li>
                                   {arr.map((tit,index) => (
                                       <li key={index}>
                                       <Link to='/' params={links}>
                                           {tit.title}
                                       </Link>
                                  </li>
                                   ))}
                            </ul>
            </div>
    )
}

export default Header;
